document.addEventListener('DOMContentLoaded', () => {
  const transactionsContainer = document.getElementById('transactionsContainer');
  const emptyState = document.getElementById('emptyState');

  const totalTransactions = document.getElementById('totalTransactions');
  const totalInflows = document.getElementById('totalInflows');
  const totalOutflows = document.getElementById('totalOutflows');
  const netBalance = document.getElementById('netBalance');

  const searchInput = document.getElementById('searchInput');
  const typeFilter = document.getElementById('typeFilter');
  const statusFilter = document.getElementById('statusFilter');

  let transactions = [
    { id: 'TX1001', type: 'deposit', status: 'completed', amount: 250.0, date: '2025-06-01 14:30', notes: 'Salary Payment' },
    { id: 'TX1002', type: 'withdrawal', status: 'pending', amount: 100.0, date: '2025-06-02 10:00', notes: 'ATM Withdrawal' },
    { id: 'TX1003', type: 'transfer', status: 'completed', amount: 75.0, date: '2025-06-03 09:15', notes: 'Transfer to savings' },
    { id: 'TX1004', type: 'payment', status: 'completed', amount: 50.0, date: '2025-06-04 13:00', notes: 'Utility Bill' },
    { id: 'TX1005', type: 'deposit', status: 'completed', amount: 500.0, date: '2025-06-05 12:00', notes: 'Bonus Payment' },
    { id: 'TX1006', type: 'withdrawal', status: 'completed', amount: 200.0, date: '2025-06-06 08:45', notes: 'Groceries' }
  ];

  function renderTransactions(data) {
    transactionsContainer.innerHTML = '';
    if (data.length === 0) {
      emptyState.style.display = 'block';
    } else {
      emptyState.style.display = 'none';
      data.forEach(tx => {
        const card = document.createElement('div');
        card.className = 'transaction-card';
        card.setAttribute('data-transaction-id', tx.id);
        card.innerHTML = `
          <div class="card-header">
            <span class="type ${tx.type}">${tx.type}</span>
            <span class="status ${tx.status}">${tx.status}</span>
          </div>
          <div class="card-body">
            <div class="amount">${tx.type === 'deposit' ? '+' : '-'} $${tx.amount.toFixed(2)}</div>
            <div class="date">${tx.date}</div>
            <div class="notes">${tx.notes}</div>
          </div>
        `;
        transactionsContainer.appendChild(card);
      });
    }
  }

  function updateSummary(data) {
    totalTransactions.textContent = data.length;
    let inflows = 0;
    let outflows = 0;
    data.forEach(tx => {
      if (tx.type === 'deposit') inflows += tx.amount;
      else outflows += tx.amount;
    });
    totalInflows.textContent = `$${inflows.toFixed(2)}`;
    totalOutflows.textContent = `$${outflows.toFixed(2)}`;
    netBalance.textContent = `$${(inflows - outflows).toFixed(2)}`;
  }

  function applyFilters() {
    const searchText = searchInput.value.toLowerCase();
    const type = typeFilter.value;
    const status = statusFilter.value;

    const filtered = transactions.filter(tx => {
      const matchesSearch = tx.id.toLowerCase().includes(searchText) ||
                            tx.notes.toLowerCase().includes(searchText);
      const matchesType = type === '' || tx.type === type;
      const matchesStatus = status === '' || tx.status === status;
      return matchesSearch && matchesType && matchesStatus;
    });

    renderTransactions(filtered);
    updateSummary(filtered);
  }

  // Event listeners for filters
  searchInput.addEventListener('input', applyFilters);
  typeFilter.addEventListener('change', applyFilters);
  statusFilter.addEventListener('change', applyFilters);

  // Initial render
  renderTransactions(transactions);
  updateSummary(transactions);

  // Modal elements
  const modal = document.getElementById('transactionModal');
  const closeModal = document.querySelector('.close-button');

  // Use event delegation to handle clicks on any transaction card
  transactionsContainer.addEventListener('click', (event) => {
    const card = event.target.closest('.transaction-card');
    if (!card) return;

    const transactionId = card.getAttribute('data-transaction-id');
    const transaction = transactions.find(tx => tx.id === transactionId);
    if (transaction) {
      document.getElementById('modalTransactionId').textContent = transaction.id;
      document.getElementById('modalTransactionDate').textContent = transaction.date;
      document.getElementById('modalTransactionType').textContent = transaction.type;
      document.getElementById('modalTransactionStatus').textContent = transaction.status;
      document.getElementById('modalTransactionAmount').textContent = `$${transaction.amount.toFixed(2)}`;
      document.getElementById('modalTransactionNotes').textContent = transaction.notes;
      modal.style.display = 'block';
    }
  });

  // Close modal on X button
  closeModal.addEventListener('click', () => {
    modal.style.display = 'none';
  });

  // Close modal on outside click
  window.addEventListener('click', (e) => {
    if (e.target === modal) {
      modal.style.display = 'none';
    }
  });

  // PDF download button
 document.getElementById('downloadPdf').addEventListener('click', (e) => {
  e.preventDefault();

    // Get transaction details from the modal
    const transactionId = document.getElementById('modalTransactionId').textContent;
    const date = document.getElementById('modalTransactionDate').textContent;
    const type = document.getElementById('modalTransactionType').textContent;
    const status = document.getElementById('modalTransactionStatus').textContent;
    const amount = document.getElementById('modalTransactionAmount').textContent;
    const notes = document.getElementById('modalTransactionNotes').textContent;

    // Create a new jsPDF instance
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();

    // Shortened base64 placeholder for logo (replace with your actual base64 string)
    const logoBase64 = 'data:image/png;base64,';

  
   // Calculate page size and margins
const pageWidth = doc.internal.pageSize.getWidth();
const pageHeight = doc.internal.pageSize.getHeight();
const leftMargin = 20;
const rightMargin = 20;

// Image properties
const imgWidth = 30;
const imgHeight = 15;
const margin = 15;
const imgX = pageWidth - imgWidth - margin;
const imgY = margin;

// Add logo image
doc.addImage(logoBase64, 'PNG', imgX, imgY, imgWidth, imgHeight);

// Draw a horizontal line under the header
doc.setDrawColor(0);
doc.setLineWidth(0.5);
doc.line(leftMargin, imgY + imgHeight + 5, pageWidth - rightMargin, imgY + imgHeight + 5);

// Title
doc.setFont('helvetica', 'bold');
doc.setFontSize(20);
doc.text('Everstead Bank', pageWidth / 2, imgY + imgHeight + 20, { align: 'center' });

doc.setFont('helvetica', 'normal');
doc.setFontSize(16);
doc.text('Transaction Receipt', pageWidth / 2, imgY + imgHeight + 30, { align: 'center' });

// Transaction details (spaced out)
let textY = imgY + imgHeight + 50;
const lineHeight = 12;
const labelX = leftMargin;
const valueX = pageWidth - rightMargin; // Align values to the right

doc.setFont('courier', 'bold');
doc.setFontSize(14);

doc.text('Transaction ID:', labelX, textY);
doc.setFont('courier', 'normal');
doc.text(transactionId, valueX, textY, { align: 'right' });
textY += lineHeight;

doc.setFont('courier', 'bold');
doc.text('Date:', labelX, textY);
doc.setFont('courier', 'normal');
doc.text(date, valueX, textY, { align: 'right' });
textY += lineHeight;

doc.setFont('courier', 'bold');
doc.text('Type:', labelX, textY);
doc.setFont('courier', 'normal');
doc.text(type, valueX, textY, { align: 'right' });
textY += lineHeight;

doc.setFont('courier', 'bold');
doc.text('Status:', labelX, textY);
doc.setFont('courier', 'normal');
doc.text(status, valueX, textY, { align: 'right' });
textY += lineHeight;

doc.setFont('courier', 'bold');
doc.text('Amount:', labelX, textY);
doc.setFont('courier', 'normal');
doc.text(amount, valueX, textY, { align: 'right' });
textY += lineHeight;

doc.setFont('courier', 'bold');
doc.text('Notes:', labelX, textY);
doc.setFont('courier', 'normal');
doc.text(notes, valueX, textY, { align: 'right' });
textY += lineHeight;

// Footer note
doc.setFont('times', 'italic');
doc.setFontSize(10);
doc.setTextColor(100);
doc.text(
  'Thank you for banking with Everstead Bank.',
  pageWidth / 2,
  pageHeight - 20,
  { align: 'center' }
);

// Save the PDF
doc.save(`Transaction_${transactionId}.pdf`);
 })
})
